// import logo from './logo.svg';
import './App.css';
import React from 'react';
import ExpenseItem from './components/ExpenseItem';

function App() {
  return (
    <>
      <div className='top-widget'>
        <p>Filter By Year</p>
        <select name="cars" id="cars" size="3">
          <option value="2021">2021</option>
          <option value="2022">2022</option>
          <option value="2023">2023</option>
          <option value="2024">2024</option>
        </select>
      </div>
      <div>
        <ExpenseItem date="2021-03-12" name="New TV" price="799.49" />
        <ExpenseItem date="2021-03-28" name="Car Insurance" price="294.67" />
        <ExpenseItem date="2021-06-12" name="New Desk(Wooden)" price="450" />
      </div>
    </>
  );
}

export default App;
